import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/auth" element={<AuthHandler />} />
                <Route path="/onebox" element={<Onebox />} />
            </Routes>
        </Router>
    );
}
